import Item from "./Item"
import {useTodo, useTodoDispatch } from "../context/TodoContext";

const List = ({todos, deleteTodo, upDateTodo}) => {

    const state = useTodo();
    const dispatch = useTodoDispatch();
    const complete = (id) => {
        deleteTodo(id)
    }
    return (
        <div>
            {state.map(todo => <Item todo={todo} complete={complete} key={todo.id}/>)}
        </div>
    );
}

export default List;
